import React from 'react';
import './Button.css';

// eslint-disable-next-line
export default props => {

    return (
            <button 
            onClick={e => props.click && props.click(e.target.innerHTML)}
            className={`
                Button
                ${props.operation ? 'operation' : ''}
                ${props.double ? 'double' : ''}
                ${props.triple ? 'triple' : ''}
            `} >
                {props.label}
            </button>
        )

}
